def solution(stdin: str) -> str:
    # Taken from
    # https://stackoverflow.com/a/597318
    # https://stackoverflow.com/a/54179745
    # https://stackoverflow.com/a/30030320
    # https://www.geeksforgeeks.org/solution-to-break-a-number-of-candies-in-circular-art-clockwise-direction-using-code/
    from collections import deque

    N, A, B = map(int, stdin.split())
    answer = 0

    # Calculate DQ
    dq = deque()
    for _ in range(N):
        if A == B:
            if len(dq) < 2:
                dq.append((A, B))
            else:
                dq.appendleft((A, B))
                dq.append(A)
        else:
            dq.append((A, B))

    # BFS
    def bfs(root, i, j):
        # To find DQ
        q = deque()
        q.append((root, i, j))
        while q:
            node, r1, c1 = q.popleft()
            for k in (r1, c1):
                if k >= 16:
                    continue
                if i == k or j == k:
                    continue
                if A <= k <= B:
                    q.append((node, k, k - A + B))
                    q.append((node, k, k - B))
                    q.append((node, k, k - A))
        return

    # DFS
    for _ in range(N):
        # if B is a valid piece of cake, bfs
        if len(dq) < 2:
            continue
        root, r1, c1 = dq.popleft()
        for k in range(r1, c1 + 1):
            if k >= 16:
                continue
            # if A is a valid piece of cake
            if A <= k <= B:
                # if A is a valid piece of cake
                if A <= k <= B:
                    # if B is a valid piece of cake
                    if B <= k <= A:
                        bfs(root, k, k - A + B)
                        dq.append((root, k, k - A))
                        dq.append((root, k, k - B))
                        dq.append((root, k, k - A))
                    # if A is a valid piece of cake
                    else:
                        bfs(root, k, k - A)
                        dq.append((root, k, k - A))
                        dq.append((root, k, k - B))
                # if A is a valid piece of cake
                else:
                    # if B is a valid piece of cake
                    if B <= k <= A:
                        bfs(root, k, k - B)
                        dq.append((root, k, k - B))
                    # if A is a valid piece of cake
                    else:
                        bfs(root, k, k - A)
                        dq.append((root, k, k - A))
                        dq.append((root, k, k - B))
        # if A is a valid piece of cake
        else:
            # if B is a valid piece of cake
            if B <= k <= A:
                bfs(root, k, k - B)
                dq.append((root, k, k - B))
            # if A is a valid piece of cake
            else:
                bfs(root, k, k - A)
                dq.append((root, k, k - A))

    # if A is a valid piece of cake
    if A <= B:
        answer = 1
    # if B is a valid piece of cake
    else:
        answer = 2

    return answer


