class Solution:
    """
    1. Sort the given string by characters.
    2. Traverse the given string from the left to the right, and for every characters with its frequency,
        If the frequency is 1, then update the string with the new characters and keep the same frequency.
    3. Traverse the given string from the right to the left, and for every characters with its frequency,
        If the frequency is 1, then update the string with the new characters and keep the same frequency.
    4. Loop through the string to get the single string after every single char.
        If the string is equal, then we have a single string.

    """
    def count_rg(self, s, i):
        if len(s) == 1:
            return 1
        if s[i] == 'R' and s[i+1] == 'G':
            return 2
        elif s[i] == 'G' and s[i+1] == 'B':
            return 2
        elif s[i] == 'B' and s[i+1] == 'R':
            return 1
        return 0

    def recurse(self, s, i, j):
        if i >= len(s) or j >= len(s):
            return 0
        if s[i] == s[j]:
            return self.recurse(s, i + 1, j + 1) + self.count_rg(s, i + 1) + self.count_rg(s, j + 1)
        else:
            return self.recurse(s, i + 1, j) + self.recurse(s, i + 1, j + 1)

    def count_rg2(self, s, i, j):
        if i >= len(s) or j >= len(s):
            return 0
        if s[i] == s[j]:
            return self.recurse(s, i + 1, j + 1) + self.count_rg2(s, i + 1, j) + self.count_rg2(s, i, j + 1)
        else:
            return self.recurse(s, i + 1, j) + self.recurse(s, i + 1, j + 1)

    def min_substring_with_one(self, s):
        """
        :type s: str
        :rtype: str
        """
        left = 0
        right = len(s) - 1
        while left < right:
            if self.count_rg2(s, left, right) == 1:
                return s[left:right + 1]
            elif self.count_rg2(s, left, right) == 0:
                left += 1
            else:
                right -= 1

    def min_substring(self, s):
        """
        :type s: str
        :rtype: str
